// PhotoPrint.js
// Detailed page for the photo printing service.

import React from 'react';
import { Link } from 'react-router-dom';

const PhotoPrint = () => {
  return (
    <div className="service-page">
      <h1>Печать фотографий</h1>
      <img
        src={process.env.PUBLIC_URL + '/img/office.png'}
        alt="Печать фотографий"
        className="service-page__image"
      />
      <p>
        Мы печатаем фотографии любого формата, включая моментальные
        полароидные снимки. Яркие краски и долговечность — наш стандарт.
      </p>
      <p><strong>Стоимость:</strong> от 30 ₽ за фотографию.</p>
      <p><strong>Срок исполнения:</strong> от 10 минут.</p>
      <Link to="/services" className="btn btn-primary">Вернуться к услугам</Link>
    </div>
  );
};

export default PhotoPrint;
